import Title from "./rick-and-morty-logo.jpg"
import "./titlebar.css"

function TitleBar(){
    return(
<div id="TitleBar">
    <img src={Title} height="70"/>
    <h1>title bar h1 </h1>
</div>
    )
}
export default TitleBar
